def test_architect_csv():
    stage1_block = Block('STAGE_1')
    stage2_block = Block('STAGE_2')
    stage3_block = Block('STAGE_3')
    stage4_block = Block('STAGE_4')
    acq_block = Block('ACQ1')
    alert_block = Block('ALERT1')
    emi_block = Block('EMI1')
    record_block = Block('RECORD1')
    i1 = InputPort(stage1_block,'Input1')
    i2 = InputPort(stage2_block,'Input1')
    i3 = InputPort(stage2_block,'Input2')
    i4 = InputPort(stage3_block,'Input1')
    i5 = InputPort(stage4_block,'Input1')
    i6 = InputPort(emi_block,'Input1')
    i7 = InputPort(alert_block, 'Input1')
    i8 = InputPort(record_block, 'Input1')
    o1 = OutputPort(stage1_block, 'Output1')
    o2 = OutputPort(stage2_block, 'Output1')
    o3 = OutputPort(stage3_block, 'Output1')
    o4 = OutputPort(stage4_block, 'Output1')
    o5 = OutputPort(acq_block, 'Output1')
    l1 = Link(o5,i1)
    l2 = Link(o1,i2)
    l3 = Link(o2,i4)
    l4 = Link(o2,i7)
    l5 = Link(o3,i5)
    l6 = Link(o3,i8)
    l7 = Link(o4,i6)
    l8 = Link(o3,i3)
    blocks = [stage1_block,stage2_block,stage3_block,stage4_block,acq_block,emi_block,alert_block,record_block]
    links = [l1,l2,l3,l4,l5,l6,l7,l8]

    file_csv = ScadeArchitectOSDCSV('a name',blocks,links)
    file_csv.write_csv(PATH_TEST_CSV)

    assert filecmp.cmp(PATH_TEST_CSV,PATH_TEST_TRUE)
    os.remove(PATH_TEST_CSV)

if __name__=="__main__":
    test()
    test_architect_csv()
